INSERT INTO `sys_article`(`id`,`title`,`alias`,`keywords`,`summary`,`content`,`original`,`copySite`,`copyURL`,`author`,`editor`,`createdDate`,`editedDate`,`status`,`type`,`views`,`sticky`,`order`,`private`,`users`,`groups`,`readers`) VALUES ('7','请各位注意保管好考勤卡以及大楼电梯卡，切勿带入国内或者第三国','','','','<p>
	<strong>Dear All，</strong>
</p>
<p>
	<strong>临近年底，大家都有休假或者回国的计划，请各位注意以下事项，以避免可能出现的一些安装状况。</strong>
</p>
<p>
	<strong>1、切勿将工作手机、工作笔记本及其他手持设备带回国内；</strong>
</p>
<p>
	<strong>2、切勿将个人工卡以及大楼考勤卡带回国内或者其他第三国；</strong>
</p>
<p>
	<strong>若回国休假，没有地方可以存放以上物品，可存放于各部门主管或者IT信息安全部。</strong>
</p>
<p>
	<strong>若不慎将以上物品遗失在国内，会存在相当大的安全风险！</strong><strong>涉及个人人身财产安全问题，请大家给予重视！</strong>
</p>
<p>
	<br />
</p>','1','','','robert','','2018-12-05 12:37:35','0000-00-00 00:00:00','normal','announce','21','0','0','0','','','robert,andy2,goslin,koma,ben,janfred,glory,loly,anson,annie,two,candy,adair,beer,eilleen1,jae,admin,misaya,tim');
