INSERT INTO `team_thread`(`id`,`board`,`title`,`content`,`author`,`editor`,`createdDate`,`editedDate`,`readonly`,`views`,`stick`,`replies`,`repliedBy`,`repliedDate`,`replyID`,`hidden`) VALUES ('3','820096','在菲律宾宿务吃喝玩乐的四种“享”法','<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	宿务素有“度假伊甸园”之美称，是菲律宾最早被开发的岛屿。在这里，古韵风情与现代活力并存，你可以品尝着鲜美的芒果，坐在螃蟹船上，追逐海豚或者潜入水底世界，享受海水与阳光……现在，推荐宿务“吃住娱购”游玩攻略，为你筹划一个完美的“私享”旅程。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	购物享法
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	这里是亚洲最实惠的购物天堂
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	亚洲最实惠的购物天堂菲律宾是让众多购物狂精神为之一振的地方，而宿务也是一个相对菲律宾其他城市较为繁华的一个，自然也会有很多特产。热带水果在这里新鲜又便宜，芒果则是最为出名，味道更是亚洲少有。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	如果想购物的话，可以到贯穿南北的琼斯大道(又称奥斯美娜大道)与科隆大道交会的地方，这里是宿务的闹市区，电影院、餐厅、百货公司等都集中于此。而且这里离圣婴教堂、麦哲伦十字架、卡尔本市场都不远，港口也在徒步范围内。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	沿着琼斯大道往科隆大道反方向走约1.5公里处，有个奥斯美娜圆环，附近有电信局、鲁宾逊百货公司，再往前走一点则有省府宿舍，一路走来有许多精致的店面。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	此外，宿务出产的工艺品价廉物美，装饰品、时装配件、精美礼品都是很好的纪念品。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	玩乐享法
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	在巴里卡萨岛，感受垂直海底悬崖的惊险
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	素有“度假伊甸园”之美称的宿务，其实除了可以前往薄荷岛神奇的巧克力山，亲密接触全世界最小的眼镜猴等奇趣好玩的旅程外，宿务还是世界浮潜胜地。在世界级浮潜圣地巴里卡萨海底探险，感受突然垂直海底悬崖的惊险。宿务的巴里卡萨岛是一个迷人的海沟，海底独特之处在于漂过浅滩，离海岸30米以外突然垂直下降150米，眼前一片暗蓝，没有大陆架斜伸入海底，90度陡峭的悬崖就在眼下，阳光透过海水，形成数道棱形光柱直指海底。来到宿务，还有到外海遇见可爱的海豚，欣赏成群海豚的精彩表演。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	宿务的夜生活在菲律宾非常有名，在遍布四处的夜总会、酒吧、咖啡厅里，你能深刻感受当地居民对音乐、舞蹈的热忱。在Cebu Plaza的Bai Bar和Waterfront Hotel的H2O，你可以尽情跳舞，也可以到卡拉OK大展歌喉，嗜酒的可以去酒吧。大部份的酒吧和夜总会都营业至凌晨时分，或等到最后的客人离开才打烊。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	美食享法
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	可以尝到烤乳猪和全世界最好吃的芒果
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	在宿务，你既可以品尝到菲律宾的特色美食烤乳猪和全世界最好吃的芒果，也可以大啖海岛特有的生猛海鲜。品尝海鲜可以去宿务的海鲜城去买生猛海鲜。宿务的鱼，有一种是名字源于宿务对抗西班牙入侵的民族英雄的拉布拉布鱼，当地人习惯以烤的方式来烹调。另一种宿务鱼叫卡东鱼，即金刺脚鱼，制法也是烤，放在铁板上上桌子，食客可以嗅到阵阵的鱼香。除此之外你更可以把鱼和大虾串起来烧，又或将花蟹解体品尝。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	宿务以烤乳猪菜式闻名的<span style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">菲律宾</span>料理餐厅Lighthouse Restaurant也值得推荐。烤至金黄的乳猪皮脆肉嫩，多吃也不腻。此外，这儿的鲜鱼、“酸汤”、椰子批、青芒果汁、甜品Halo-halo等都是菲律宾地道风味，值得尝试。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	另外还有菲律宾前总统夫人都是他家常客的Abaca餐厅。近年，餐厅更摇身一变成为一所精品酒店，提供高级海景villa，游客除可在餐厅内品尝佳肴外，亦可向Abaca要求安排到附近无人小岛上的白沙滩享受一顿奢侈的海上晚餐。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	如果你想享受一顿特别的私人美食，可以到薄荷岛的罗博河。这里最大特色是泛舟罗博河，一边观赏着河道两边的原始森林风貌，一边品尝船上美味的自助餐，船家会为你准备丰盛地道的菲式料理：烤鸡腿、大虾、茄子夹肉、烤鱼、螃蟹、沙拉……
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	酒店享法
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	香格里拉麦丹岛度假酒店：用绝佳的视角来欣赏麦丹海
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	到“度假伊甸园”宿务旅行，香格里拉麦丹岛度假酒店是住宿“享”法的一大亮点。其中值得尝试的是酒店现今焕然一新的海景房，提供奢华和宽敞无比的住宿享受，美丽的米沙鄢海就在窗外。客房的装饰既体现了现代的菲律滨家居风格，又结合了麻、贝壳、香蕉叶和藤条等自然古朴的元素。私人阳台提供了绝佳的视角来欣赏麦丹海以及环绕四周的香格里拉海洋保护区和小岛。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	酒店还提供7家不同风味的美食选择，有A cqua新餐厅供应最好的现代意大利菜，还有Cow rie Cove，位于海滩边，是品尝海鲜的理想去处。夕阳西下的时候，可以在热闹的Chill O ut酒吧坐坐。此外，无论家庭探险还是纯粹的放松，酒店也为成人和小孩提供的一系列有趣活动。酒店标志性项目———“气”Spa，是亚洲最大型最豪华的Spa，酒店在专门的Spa别墅或Spa套房里提供每项服务。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	攻略
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	交通：现在有直飞宿务的行程，免去转机的麻烦，三个小时就可以直达宿务。宿务当地拥有大量出租车和<span style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">菲律宾</span>独有的吉普车，还有机动载客的三轮车，均可以选择，价格便宜方便，但游客一定要谈好价钱再上车。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	货币：建议先在国内换好美元，再在<span style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">菲律宾</span>的机场里兑换成比索，大型百货均可刷VISA或MASTER CARD。
</p>
<p style=\"color:#1F3C82;font-family:宋体;font-size:15px;background-color:#F7F8FA;\">
	禁忌：参观教堂、清真寺或寺庙时绝不要只穿短裤或无袖衬衫。
</p>','tim','tim','2018-11-29 16:16:43','2018-11-29 16:20:36','0','18','0','0','','2018-11-29 16:16:43','0','0');
