INSERT INTO `team_thread`(`id`,`board`,`title`,`content`,`author`,`editor`,`createdDate`,`editedDate`,`readonly`,`views`,`stick`,`replies`,`repliedBy`,`repliedDate`,`replyID`,`hidden`) VALUES ('7','820095','关于菲律宾的十八个为什么','<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓，近年來因為東盟的崛起，開始得到更多的關注。許多人都希望能夠前往菲律賓淘金，但是對於菲律賓，卻有著許許多多的疑惑。本篇文章整理了大家最常問的問題，將問題的答案娓娓道來，為大家解惑！
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<span id=\"more-435\"></span>
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	1、菲律賓人說什麼話？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓人的官方語言是英文及他加祿語（Tagalog），但除此之外，在各地皆有專屬於各地的方言，最多人講的方言是Ilongo，主要在中部未獅耶群島能通行。但如果是初次接觸菲律賓，只要你會說英語，便已足矣。
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"https://i0.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_01.jpg\"><img class=\"alignnone size-full wp-image-437\" src=\"https://i0.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_01.jpg?resize=525%2C350\" alt=\"pic_01\" width=\"524\" height=\"350\" style=\"height:auto;\" /></a>
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	2、那菲律賓的人英文很好對不對？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	其實這就要看好的定義，基本的日常會話跟溝通，大至政府官員，小至販夫走卒都沒有問題，如果說是要商務談判，那自然需要較高深的語言能力。但如果只是要來觀光或者是做點小生意，只要會基本的英語，即可達到80%溝通的目的。
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	3、菲律賓是不是很落後？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	過去我們對菲律賓的印象，停留在勞力輸出、經濟水平低落。但這些年來，菲律賓的經濟正在不斷地成長，尤其近三年的GDP甚至都超過5%，在東盟各國裡面表現相當亮眼。菲律賓目前還有25%的人生活在貧窮線底下，但富麗堂皇的建築以及奢華的精品，也都在都會區裡頭蓬勃發展。用「落後」來形容菲律賓，只能形容到部分；應該要說，這是個貧富差距很大的國家，但其先進的地方，可是能跟中國的一線城市平起平坐的呢！
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"https://i2.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_02.jpg\"><img class=\"alignnone size-full wp-image-438\" src=\"https://i2.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_02.jpg?resize=525%2C350\" alt=\"pic_02\" width=\"524\" height=\"350\" style=\"height:auto;\" /></a>《首善之都馬尼拉市區馬卡蒂購物商場外的夜景，photograph by&nbsp;<a href=\"http://mrlin.tw/philpic/\">PhilPic</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	4、菲律賓的治安是不是很差？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	其實應該這麼說，每一個國家都有治安好與壞的地方，如果單純地貼上治安差的標籤，對菲律賓來講是很不公平的。哪個國家沒有搶劫，哪個國家沒有偷竊呢？即便是歐洲的先進國家，在地鐵站的搶劫扒竊，也都時有所聞，不是嗎？菲律賓的治安或許不好，但你不論到哪個國家，財不露白都是最基本的自保之道。在暗巷裡走著，只有你身上穿金戴銀拿著最新的iPhone7，歹徒不搶你，搶誰呢這是？
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	5、菲律賓很多毒販嗎？新聞說的都是真的？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	是的，過去的菲律賓中下階層長期受毒品氾濫所影響，深受其害。但在新任總統杜特爾特上任之後，大力掃毒，從上層的大毒梟到底層的小毒販，都在嚴刑峻法上被處置，自首人數破數十萬，許多民眾為了保命，都主動自首，創下紀錄，一方面也代表著新政府來真的，另一方面，當地的民調顯示，有超過七成的民眾支持杜特爾特這樣極端的處置方式，菲律賓人普遍認為，長期以來的迂腐與敗壞，非得靠這樣的手段來解決問題，理當全力支持。這幾個月來，菲律賓的毒品交易大幅減少，人人自危，相較起往年的氾濫，已經改善不少。
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	6、菲律賓的東西好吃嗎？它們吃什麼？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓的飲食文化相當多元，除了承繼了美式的炸雞漢堡披薩之外，由於氣候的關係，此處的菲律賓菜色也相當獨特，口味酸甜，不辣不澀，菲律賓物產豐饒，料理中常用在地的蔬菜以及海鮮來進行烹飪；不同的地區甚至有不同的特色料理，如馬尼拉地區有著令人回味無窮的halohalo綜合冰沙，在宿霧地區也有令人垂涎三尺的烤乳豬，在在都讓來訪的旅客舌尖驚豔，流連忘返。甚至，連全菲律賓到哪都看得到的國民小吃，可是來自中國的「燒賣」呢！
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"https://i2.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_04.jpg\"><img class=\"alignnone size-full wp-image-439\" src=\"https://i2.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_04.jpg?resize=525%2C350\" alt=\"pic_04\" width=\"524\" height=\"350\" style=\"height:auto;\" /></a>《菲律賓的特色菜餚─脆皮燒肉(Liempo)，photograph by&nbsp;<a href=\"http://mrlin.tw/philpic/\">PhilPic</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	7、菲律賓的天氣怎麼樣？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓處於熱帶地區，也是在西太平洋的海島國家，年均溫在26度以上，沒有四季，只有乾季與雨季之分，雨季約從五月開始，一路到九月，其餘時間都是乾季，降雨相對較少，但高溫有時會來到38度以上。如果來菲律賓，是不用準備貂皮大衣的，即便是到有菲律賓避暑山城之稱的碧瑤，最涼也不過在20度左右，跟內地其他地方的低溫相較之下，根本不值一提。菲律賓的炎熱，也使得此地的人民有著海島國家的樂天與不拘小節的個性，來到這最先要適應的，就是這樣獨特的爽朗呢！
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	8、菲律賓是不是一堆沙灘，都在海邊？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	可以這麼說，但也不可以這麼說。菲律賓大大小小的島嶼加起來有七千多個，當地華人也賦予了「千島之國」的雅稱。但主要的區域分成三大部分，分別是呂宋島、中部未獅耶群島、南部岷蘭佬群島。呂宋島的大小大約是福建省的80%，自然有山也有海，並不完全都在海邊，也有許多的山景可以欣賞甚至旅遊，而且還有好幾座活火山喔！即便是從首都馬尼拉要前往最近有沙灘的熱門度假勝地描東岸（Batangas），也得開上三小時的車，才能抵達呢！知名的旅遊景點宿霧跟長灘島，也都得從馬尼拉近兩個小時才能抵達的！
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"http://www.mrlin.tw/philpic/photography/0003/\"><img class=\"alignnone size-full\" src=\"https://i1.wp.com/www.mrlin.tw/philpic/wp-content/uploads/2016/09/0003.jpg?zoom=1.25&amp;resize=524%2C350\" alt=\"\" width=\"524\" height=\"350\" style=\"height:auto;\" /></a>《菲律賓知名度假勝地長灘島，photograph by&nbsp;<a href=\"http://mrlin.tw/philpic/\">PhilPic</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	9、菲律賓人的膚色是不是都較黝黑？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	這是錯誤的刻板印象喔！菲律賓的原生態雖然沿襲著南島語系，但在經過西班牙近四百年的統治，以及美國、日本、中國等種族的融合，並非所有的菲律賓人膚色都相當黝黑呢！也有許多的菲律賓人，膚色較白，讓你第一眼還看不出來是來自菲律賓的。只能說，這是個種族融合的國度，需要花更多的時間去理解跟認識才行。
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"http://www.starmometer.com/\"><img class=\"alignnone size-full\" src=\"https://i0.wp.com/www.starmometer.com/wp-content/uploads/2015/12/Top-10-Sexiest-Men-1-1.jpg?zoom=1.25&amp;resize=524%2C334\" alt=\"\" width=\"524\" height=\"334\" style=\"height:auto;\" /></a>《菲律賓2015百大性感男星前十名，by&nbsp;<a href=\"http://www.starmometer.com/\">Starmometer</a>》
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"https://paddylastinc.com/2016/07/07/2016-fhm-philippines-full-list-of-100-sexiest-women-in-the-world/\"><img class=\"alignnone wp-image-440 size-full\" src=\"https://i0.wp.com/www.mrlin.tw/blog/wp-content/uploads/2016/10/Pic_07.jpg?resize=525%2C271\" alt=\"pic_07\" width=\"524\" height=\"270\" style=\"height:auto;\" /></a>《菲律賓2016百大性感女星前十名，整理自<a href=\"https://paddylastinc.com/2016/07/07/2016-fhm-philippines-full-list-of-100-sexiest-women-in-the-world/\">paddylastinc</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	10、菲律賓人的娛樂是什麼？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓的購物商場相當多，光是在大馬尼拉地區就有超過一百間的shopping mall，而且每一間mall的功能都相當完整且多元，除了各品牌的進駐之外，遊樂場、電影院、診所、美容spa、理髮沙龍、快遞、美食街等等，在mall裡面都找得到！菲律賓的mall，功能齊全得就像微信一般，已經是菲律賓人生活中不可分割的一部份囉！
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<a href=\"http://www.mrlin.tw/philpic/photography/0007/\"><img class=\"alignnone size-full\" src=\"https://i0.wp.com/www.mrlin.tw/philpic/wp-content/uploads/2016/09/0007.jpg?zoom=1.25&amp;resize=524%2C350\" alt=\"\" width=\"524\" height=\"350\" style=\"height:auto;\" /></a>《首都馬尼拉的購物商場，photograph by&nbsp;<a href=\"http://mrlin.tw/philpic/\">PhilPic</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	11、菲律賓買得到中國或臺灣的東西嗎？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	可以的！菲律賓的華人很常到內地補貨，不論是在中國城或者是馬卡蒂，都有許多的中國超市可以買到來自中國或台灣的產品，想要一解思鄉情懷，走一趟中國超市就對了！以馬尼拉來說，中國城的大豐超市以及馬卡蒂的台北超市，可是異鄉遊子的最佳去處呢！
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	12、菲律賓有什麼樣的工作，我要如何找到當地的工作呢？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	菲律賓目前正在蓬勃發展，特別是金融業以及博彩業，金融業乃是因為有亞洲開發銀行的背景，對於具有亞洲觀的華人需求，力道特別強烈；博彩業則是近年來在菲律賓政府的開放底下，吸引更多華人前往投資與就業的特殊產業，而要怎麼找這些產業相關的工作呢？嘿嘿，這你可就看對文章啦！巔峰國際顧問已經整理談菲律賓工作該注意的事項，請看：《<a href=\"http://dianfengph.com/%E5%A6%82%E4%BD%95%E6%89%BE%E5%9B%BD%E5%A4%96%E5%B7%A5%E4%BD%9C%EF%BC%9F%E8%B0%88offer%E6%97%B6%E8%AF%A5%E6%B3%A8%E6%84%8F%E4%BB%80%E4%B9%88%EF%BC%9F/\">如何找国外工作？谈offer时该注意？</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	13、到菲律賓，要帶些什麼東西呢？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	其實這取決於你的生活習慣，但是基本上，生活用品在菲律賓都是買得到的。至於需要哪些東西？請看此篇文章：《<a href=\"http://dianfengph.com/%E8%8F%B2%E5%BE%8B%E8%B3%93%E8%A1%8C%E5%89%8D%E6%B3%A8%E6%84%8F%E4%BA%8B%E9%A0%85%E4%B8%8E%E8%A1%8C%E6%9D%8E%E6%B8%85%E5%8D%95/\">菲律宾行前注意事项与行李清单</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	14、菲律賓有大眾運輸可以搭乘嗎？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	有的，菲律賓的大眾運輸主要有火車、吉普尼、地鐵以及巴士，地鐵目前只有三條線，而且比較少華人會搭乘，一來是因為能抵達的地方有限，二來則是因為比較擁擠，搭起來非常不舒服。至於其他的交通方式？請看此篇文章的介紹：《<a href=\"http://dianfengph.com/%E8%8F%B2%E5%BE%8B%E5%AE%BE%E4%BA%A4%E9%80%9A%E6%96%B9%E5%BC%8F%E5%A4%A7%E5%89%96%E6%9E%90/\">菲律宾交通方式大剖析</a>》
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	15、菲律賓有什麼跨國企業設點在這嗎？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	有的！菲律賓近期的發展突飛猛進，相當多的跨國企業也將總部設立於此，特別是BGC。像是CNN Philippines、Google、Facebook、KPMG、AirAsia等等，說馬尼拉是亞洲首屈一指的國際化城市，一點也不為過！
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	16、馬尼拉好像很大，哪些地方是比較便利的啊？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	大馬尼拉地區（Metro Manila, NCR）其實涵括了17個行政區（City），而這17個行政區裡，較為繁榮的就是Makati, Taguig, Pasay, Pasig, Mandaluyong，而人口最多的則是Quezon，約有230萬人口，全世界最大的購物商場之一SM North EDSA便座落於此。
</p>
<p style=\"font-family:&quot;font-size:16px;\">
	<span class=\"embed-youtube\">
	
	
</span>
</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	17、聽說Makati很繁榮，大概有多繁榮啊？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	Makati一直以來都是菲律賓的金融中心，繁榮的程度大約就像是中國沿海的一線城市，也有許多台灣人把它稱為「菲律賓的信義區」，所有國際化的城市應該有的樣貌，這裡一個也不缺。不僅僅只是跨國企業都會將辦公室設立在此，購物商場的繁榮更是令人趨之若鶩，流連忘返呢！
</p>
