</p>
<h2 style=\"color:#666666;font-size:1.625rem;font-family:&quot;\">
	18、我拿到了菲律賓的工作機會，我要怎麼判別這份工作是好或是壞呢？
</h2>
<p style=\"font-family:&quot;font-size:16px;\">
	可以加入一些菲律賓的相關社團進行討論，可以上臉書搜尋相關的菲律賓社團，或者是到<a href=\"http://dianfengph.com/\">巔峰官網</a>進行詢問，將可以省去許多篩選歸納的功夫喔！
</p>
